var util = require('../../utils/util.js');
var sliderWidth = 96; // 需要设置slider的宽度，用于计算中间位置

Page({
  data: {
    tabs: ["最新歌曲", "VIP曲库"],
    activeIndex: 0,
    sliderOffset: 0,
    sliderLeft: 0,
    imgUrls: [
      'data:image/png;base64,'
    ],
    indicatorDots: true,
    indicatorColor: '#ccc',
    indicatorAactiveColor: "#fff",
    autoplay: true,
    interval: 5000,
    lists: '',
    currentPage: 0,
    totalPage: 1,
    address: util.address,
    vipLists:'',
    viptotal:1,
    vipcur:0
  },
  // 进入歌曲播放页面
  gotoPlayControlle: function (e) {
    wx.navigateTo({
      url: '../playControll/playControll?id=' + e.currentTarget.id
    })
  },
  /**
   * 生命周期函数--监听页面加载
   */
  onLoad: function () {
    var that = this;
    // swiper
    wx.getSystemInfo({
      success: function (res) {
        that.setData({
          sliderLeft: (res.windowWidth / that.data.tabs.length - sliderWidth) / 2,
          sliderOffset: res.windowWidth / that.data.tabs.length * that.data.activeIndex
        });
      }
    });
    // songs
    util.getListsItems(that.data.currentPage + 1, function (data) {
      that.setData({
        lists: data.list,
        currentPage: data.curPage,
        totalPage: data.totalPage
      });
    })
    // vip vipLists
    util.songDetail(util.address +'/index.php/api/vipsongs/1',(data)=>{
      that.setData({
        vipLists: data.data.data.list,
        vipcur: data.data.data.curPage,
        viptotal: data.data.data.totalPage
      });
    })
  },
  // loadmore
  lower: function () {
    var thss = this;
    if (thss.data.currentPage < thss.data.totalPage) {
      util.getListsItems(Number(thss.data.currentPage) + 1, function (data) {
        thss.setData({
          lists: thss.data.lists.concat(data.list),
          currentPage: data.curPage,
          totalPage: data.totalPage
        });
      })
    }
  },
  // navTab
  tabClick: function (e) {
    this.setData({
      sliderOffset: e.currentTarget.offsetLeft,
      activeIndex: e.currentTarget.id
    });
  },
  // vip 下拉
  viplower(){
    var thss = this;
    if (thss.data.vipcur < thss.data.viptotal) {
      util.songDetail(util.address + '/index.php/api/vipsongs/' + (Number(thss.data.currentPage) + 1), (data) => {
        that.setData({
          vipLists: data.data.data.list,
          vipcur: data.data.data.curPage,
          viptotal: data.data.data.totalPage
        });
      })
    }
  }
});
